function contains(e,t,n="NFKC"){const s=e.text.normalize(n);for(let e=0;e<t.length;e++){const o=t[e].normalize(n),i=s.indexOf(o);if(i<0)return!1}return!0}onmessage=function(e){const n=e.data.phrases,s=e.data.articleBuffer,o=JSON.parse((new TextDecoder).decode(s)),t=[];for(let s=e.data.start;s<e.data.end;s++){const i=o[s];contains(i,n)&&t.push({link:i.link,title:i.title})}postMessage(t)}